      string: '{"model":"gpt-4o-2024-11-20","messages":[{"role":"system","content":"You
        are a bot that makes connections.\nPeople message you when they need something
        and whenever you feel you have enough information you let them know that you
        will be on the lookout for any users that can be of use to them.\nYou need
        enough detail about something before you can make a search so you can find
        someone that is a good match.\nOnce you have made a match the search is complete,
        until a user wants something else or requests another match.\n"},{"role":"user","content":"We
        are now trying to find the best match for the searching user.\nGiven the user
        and two other users along with their conversation histories,\nreturn the user
        id of the best match for the searching user. return only a user_id.\nEven
        if both users are a poor match, return the best possible option.\n\n\n===========================\n\nExample
        response: 521\n\n\nsearching user\nUSER CONVERSATION\nuser id: 3\nuser first
        name: Douglas\n\n\ndate: 2024-11-30 20:18:15\nrole: user\ncontent: I''m a
        founder at an early stage SaaS startup with a great product looking to bring
        on full stack web developers with 2-4 years SaaS experience who are available
        to work full time in person in NYC.\n\n\n\npossible match\nUSER CONVERSATION\nuser
        id: 1\nuser first name: Malcom\n\n\ndate: 2024-11-30 20:18:15\nrole: user\ncontent:
        I''m a software engineer in NYC with experience using Ruby on Rails at several
        SaaS startups. Looking for a new in-person position with good benefits and
        work life balance.\n\n\n\npossible match\nUSER CONVERSATION\nuser id: 2\nuser
        first name: Willette\n\n\ndate: 2024-11-30 20:18:15\nrole: user\ncontent:
        I''m looking for a roommate to sign a new lease in Park Slope, Brooklyn.\n\n\n"}],"response_format":null,"temperature":0.5,"store":true,"metadata":{"type":"comparison","environment":"test"}}'
